import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import '../components/Header.css';

function Home() {
    const [stars, setStars] = useState([]);
    
    const openUrl=()=> {
        
        window.open("http://localhost:7000", "_blank");
    }
    

    useEffect(() => {
        const fetchStars = async () => {
            try {
                const response = await axios.get('/api/stars');
                setStars(response.data);
            } catch (err) {
                console.error("Error fetching stars:", err);
            }
        };
        fetchStars();
    }, []);

    return (
        <>
        <div className='container-fluid mw-50 mh-10 mt-5 p-5'>
        <button className='btn btn-secondary position-absolute top-55 end-0 translate-middle-y' onClick={openUrl}>Upload / Capture</button>

            <h2>Welcome to Starlight Tracker</h2>
            <h3>Famous Stars</h3>
            {/*<ul>
                {stars.map(star => (
                    <li key={star.id}>{star.name}</li>
                ))}
            </ul>*/}
    </div>
    <div className='album bg-body-tertiary'>
            <div className='container text-dark mw-100 p-5'>
             
              <div className='row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3'>
                <div className='col'>
                  <div className="card bg-info-subtle position-static" style={{width:"18rem"}}>
                    <img src='/' className="card-img-top" alt="Img not found"/>
                    <div className="card-body">
                      <h5 className="card-title">Title</h5>
                      
                      <a href="/" className="btn" style={{backgroundColor:"navy", color:'white'}}>Have a look</a>
                    </div>
                  </div>
                </div>
                </div>
                </div>
                </div>
        </>
    );
}

export default Home;
